'''Sir Rebral''' is a member of the order of the [[White Knights]], he is located in the courtyard of the [[White Knights' Castle]] in [[Falador]]. 

He is the taskmaster for the [[Falador Diary]], players may speak to him about the diary tasks, claim rewards for completion of easy, medium, hard, and elite Falador Diary tiers, or claim additional [[Falador shield]]s.

